import {GoogleGenAI, LiveServerMessage, Modality, Session} from '@google/genai';
import {LitElement, css, html} from 'lit';
import {customElement, state, query} from 'lit/decorators.js';
import {createBlob, decode, decodeAudioData} from './utils';
import './visual-3d';
import {GdmLiveAudioVisuals3D} from './visual-3d';

const SYSTEM_INSTRUCTION = `# SYSTEM INSTRUCTION: THANHDONG ENGLISH COACH (Multimodal/Exhibition Version)

## 1. IDENTITY & PURPOSE
You are **ThanhDong English Coach**, an elite AI pronunciation tutor powered by multimodal audio capabilities.
* **Target Audience:** Vietnamese students and exhibition visitors.
* **Environment:** Often used in **noisy exhibition settings**.
* **Linguistic Standard:** **General American (GenAm)** English.
* **Core Value:** Constructive, concise, and highly tolerant of environmental noise. You prioritize "Intelligibility" over academic perfection.

## 2. AUDIO PROCESSING PROTOCOL (CRITICAL)
Since you receive direct audio input in a potentially noisy environment:

1.  **Signal-to-Noise Check:**
    * If the user's voice is drowned out by background noise or is unintelligible, **DO NOT GUESS**.
    * *Fallback Action:* Politely ask the user to speak closer to the mic or repeat the sentence loud and clear. (e.g., "Ồn quá mình chưa nghe rõ, bạn nói to lại giúp mình nhé!").
2.  **Speech Detection:**
    * Focus only on the primary voice closest to the microphone. Ignore background chatter.
3.  **Latency:**
    * Keep your response generation strictly concise to minimize waiting time during live demos.

## 3. PEDAGOGICAL FRAMEWORK (Vietnamese Focused)
You must analyze the user's English through the lens of **Contrastive Analysis (Vietnamese vs. American English)**.

### Common Vietnamese Errors to Detect:
* **Ending Sounds:** Dropping final consonants (e.g., "fi" instead of "five", "ni" instead of "nice"). -> *Priority Fix.*
* **Monotone:** Speaking without intonation (flat pitch). -> *Encourage American "Music" (Pitch variation).*
* **Short/Long Vowels:** Confusing /i/ and /i:/ (e.g., sit vs. seat).
* **Consonant Clusters:** Adding schwa sounds (e.g., "sport" -> "sơ-pót").
* **Th-Sounds:** Pronouncing 'th' as 't' or 'd' or 'z'.

## 4. INTERACTION FLOW

**Step 1: LISTEN & ANALYZE (Internal Monologue)**
* Listen to the audio input.
* Isolate the user's speech from noise.
* Compare against General American standard.
* Identify ONE major error (don't overwhelm the user) and ONE good point.

**Step 2: RESPONSE GENERATION (The Output)**
Your output must strictly follow this structure:

1.  **Khích lệ (Encouragement):** A short, positive opener in Vietnamese.
2.  **Sửa lỗi trọng tâm (The Fix):** Point out the *most significant* error using Vietnamese explanations. Explain *how* to fix it physically (mouth/tongue position).
    * *Constraint:* Be brief. No long lectures.
3.  **Làm mẫu (The Model):** Provide the correct pronunciation in English (General American).
    * *Note:* Since you are an AI, emphasize the corrected sound clearly.
4.  **Phiên âm (Optional but helpful):** Provide simple IPA or "Vietnamese-style phonetic spelling" if the word is hard.

## 5. TONE & STYLE GUIDELINES
* **Friendly & Energetic:** Keep the vibe high for the exhibition context.
* **Bilingual Switching:** Explain in Vietnamese, demonstrate in English.
* **No Hallucinations:** Never claim to use external "tools" or "software." You rely on your own hearing.
* **American Bias:** Enforce Rhoticity (pronounced 'r' in *car, water*). Use Flap T ( *water* sounds like *wader*).
`;

@customElement('gdm-live-audio')
export class GdmLiveAudio extends LitElement {
  @state() isRecording = false;
  @state() status = '';
  @state() error = '';
  @state() visualErrorState = false;

  @query('gdm-live-audio-visuals-3d')
  visualizer!: GdmLiveAudioVisuals3D;

  private client: GoogleGenAI;
  private sessionPromise: Promise<Session>;
  private inputAudioContext = new (window.AudioContext ||
    (window as any).webkitAudioContext)({sampleRate: 16000});
  private outputAudioContext = new (window.AudioContext ||
    (window as any).webkitAudioContext)({sampleRate: 24000});
  @state() inputNode = this.inputAudioContext.createGain();
  @state() outputNode = this.outputAudioContext.createGain();
  private nextStartTime = 0;
  private mediaStream: MediaStream;
  private sourceNode: AudioBufferSourceNode;
  private scriptProcessorNode: ScriptProcessorNode;
  private sources = new Set<AudioBufferSourceNode>();
  private errorTimeout: number | undefined;

  static styles = css`
    :host {
      display: block;
      width: 100vw;
      height: 100vh;
      overflow: hidden;
      background-color: #050a14;
      font-family: 'Courier New', monospace;
    }

    #title {
      position: absolute;
      top: 5vh;
      left: 0;
      right: 0;
      z-index: 10;
      pointer-events: none;
      
      /* Flex Layout for Logo + Text */
      display: flex;
      flex-direction: row;
      align-items: center;
      justify-content: center;
      gap: 20px;
    }
    
    .logo {
      width: 70px;
      height: 70px;
      object-fit: contain;
      /* Holographic Neon Filter Chain: Gray -> Sepia -> Cyan -> Glow */
      filter: grayscale(100%) brightness(1.2) sepia(100%) hue-rotate(130deg) saturate(300%) drop-shadow(0 0 8px #00f3ff);
      opacity: 0.9;
    }
    
    .title-content {
      display: flex;
      flex-direction: column;
      align-items: flex-start;
    }

    #title h1 {
      font-size: 2.5rem;
      margin: 0;
      padding: 0;
      font-weight: 700;
      letter-spacing: 4px;
      color: #00f3ff;
      text-shadow: 0 0 10px #00f3ff, 0 0 20px #00f3ff;
      text-transform: uppercase;
      line-height: 1;
    }

    #title p {
      margin-top: 5px;
      font-size: 0.9rem;
      color: rgba(0, 243, 255, 0.6);
      letter-spacing: 2px;
      text-transform: uppercase;
      font-weight: 400;
    }
    
    #title hr {
      width: 100%;
      border: 0;
      height: 1px;
      background: linear-gradient(90deg, #00f3ff, transparent);
      margin: 8px 0;
      opacity: 0.5;
    }

    #status {
      position: absolute;
      bottom: 20vh;
      left: 0;
      right: 0;
      z-index: 10;
      text-align: center;
      color: #ff3333;
      text-shadow: 0 0 5px #ff3333;
      font-size: 0.8rem;
      letter-spacing: 1px;
    }

    .controls {
      z-index: 10;
      position: absolute;
      bottom: 8vh;
      left: 0;
      right: 0;
      display: flex;
      align-items: center;
      justify-content: center;
      gap: 30px;
    }

    button {
      outline: none;
      background: linear-gradient(135deg, rgba(0, 243, 255, 0.2), rgba(0, 100, 110, 0.2));
      border: none;
      color: #00f3ff;
      font-family: 'Courier New', monospace;
      font-weight: 700;
      letter-spacing: 2px;
      text-transform: uppercase;
      font-size: 1rem;
      
      /* Hexagonal/Angular Shape */
      clip-path: polygon(15% 0, 100% 0, 100% 70%, 85% 100%, 0 100%, 0 30%);
      
      width: 160px;
      height: 50px;
      cursor: pointer;
      padding: 0;
      margin: 0;
      transition: all 0.2s ease;
      display: flex;
      align-items: center;
      justify-content: center;
      position: relative;
    }

    /* Simulate a border using a pseudo element if needed, or simple background */
    button::before {
      content: '';
      position: absolute;
      inset: 0;
      background: #00f3ff;
      clip-path: polygon(15% 0, 100% 0, 100% 70%, 85% 100%, 0 100%, 0 30%);
      z-index: -1;
      opacity: 0.2;
    }

    button:hover {
      background: #00f3ff;
      color: #050a14;
      box-shadow: 0 0 20px rgba(0, 243, 255, 0.6);
    }
    
    button:active {
      transform: scale(0.98);
    }

    button[disabled] {
      opacity: 0.5;
      pointer-events: none;
      filter: grayscale(100%);
    }
    
    /* Specific style for Replay vs Record if needed, but keeping uniform for sci-fi look */
    
    gdm-live-audio-visuals-3d {
      width: 100%;
      height: 100%;
    }
  `;

  constructor() {
    super();
    this.initClient();
  }

  private initAudio() {
    this.nextStartTime = this.outputAudioContext.currentTime;
  }

  private async initClient() {
    this.initAudio();

    this.client = new GoogleGenAI({
      apiKey: process.env.API_KEY,
    });

    this.outputNode.connect(this.outputAudioContext.destination);

    this.initSession();
  }

  private initSession() {
    const model = 'gemini-2.5-flash-native-audio-preview-09-2025';

    this.sessionPromise = this.client.live.connect({
      model: model,
      callbacks: {
        onopen: () => {
          this.updateStatus('System Online');
        },
        onmessage: async (message: LiveServerMessage) => {
          // 1. Handle Audio
          const audio =
            message.serverContent?.modelTurn?.parts[0]?.inlineData;

          if (audio) {
            this.nextStartTime = Math.max(
              this.nextStartTime,
              this.outputAudioContext.currentTime,
            );

            const audioBuffer = await decodeAudioData(
              decode(audio.data),
              this.outputAudioContext,
              24000,
              1,
            );
            const source = this.outputAudioContext.createBufferSource();
            source.buffer = audioBuffer;
            source.connect(this.outputNode);
            source.addEventListener('ended', () => {
              this.sources.delete(source);
            });

            source.start(this.nextStartTime);
            this.nextStartTime = this.nextStartTime + audioBuffer.duration;
            this.sources.add(source);
          }
          
          // 2. Handle Text (Error Detection)
          // We check if the model returns text indicating a correction.
          // Based on System Instruction, it usually says "Tuy nhiên", "Sửa lỗi", "Lỗi", "Incorrect"
          const textPart = message.serverContent?.modelTurn?.parts?.find(p => p.text)?.text;
          if (textPart) {
             const lowerText = textPart.toLowerCase();
             // Keywords in Vietnamese/English that imply an error was found
             if (lowerText.includes('lỗi') || lowerText.includes('sai') || lowerText.includes('tuy nhiên') || lowerText.includes('chưa đúng')) {
                this.triggerVisualError();
             }
          }

          const interrupted = message.serverContent?.interrupted;
          if (interrupted) {
            for (const source of this.sources.values()) {
              source.stop();
              this.sources.delete(source);
            }
            this.nextStartTime = 0;
          }
        },
        onerror: (e: ErrorEvent) => {
          this.updateError('System Error: ' + e.message);
        },
        onclose: (e: CloseEvent) => {
          this.updateStatus('System Offline: ' + e.reason);
        },
      },
      config: {
        systemInstruction: SYSTEM_INSTRUCTION,
        responseModalities: [Modality.AUDIO],
        speechConfig: {
          voiceConfig: {prebuiltVoiceConfig: {voiceName: 'Zephyr'}},
        },
      },
    });

    this.sessionPromise.catch((e) => {
      console.error(e);
      this.updateError(e.message);
    });
  }
  
  private triggerVisualError() {
      // Flash Red for 2 seconds
      this.visualErrorState = true;
      if (this.errorTimeout) clearTimeout(this.errorTimeout);
      this.errorTimeout = window.setTimeout(() => {
          this.visualErrorState = false;
      }, 2000);
  }

  private updateStatus(msg: string) {
    this.status = msg;
  }

  private updateError(msg: string) {
    this.error = msg;
  }

  private async startRecording() {
    if (this.isRecording) {
      // If already recording, this button acts as a toggle or ignored?
      // Design requirement says "Replay" and "Record". Assuming "Record" toggles or starts.
      // Let's make it act as "Stop" if already recording, or ignore.
      // For this prototype, let's treat it as Start.
      return;
    }

    this.inputAudioContext.resume();
    this.updateStatus('Listening...');

    try {
      this.mediaStream = await navigator.mediaDevices.getUserMedia({
        audio: true,
        video: false,
      });

      this.sourceNode = this.inputAudioContext.createMediaStreamSource(
        this.mediaStream,
      );
      this.sourceNode.connect(this.inputNode);

      const bufferSize = 4096;
      this.scriptProcessorNode = this.inputAudioContext.createScriptProcessor(
        bufferSize,
        1,
        1,
      );

      this.scriptProcessorNode.onaudioprocess = (audioProcessingEvent) => {
        if (!this.isRecording) return;

        const inputBuffer = audioProcessingEvent.inputBuffer;
        const pcmData = inputBuffer.getChannelData(0);

        this.sessionPromise.then((session) => {
          session.sendRealtimeInput({media: createBlob(pcmData)});
        });
      };

      this.sourceNode.connect(this.scriptProcessorNode);
      this.scriptProcessorNode.connect(this.inputAudioContext.destination);

      this.isRecording = true;
    } catch (err) {
      console.error('Error starting recording:', err);
      this.updateStatus(`Error: ${err.message}`);
      this.stopRecording();
    }
  }

  private stopRecording() {
    if (!this.isRecording && !this.mediaStream && !this.inputAudioContext)
      return;

    this.updateStatus('Analyzing...');

    this.isRecording = false;

    if (this.scriptProcessorNode && this.sourceNode && this.inputAudioContext) {
      this.scriptProcessorNode.disconnect();
      this.sourceNode.disconnect();
    }

    this.scriptProcessorNode = null;
    this.sourceNode = null;

    if (this.mediaStream) {
      this.mediaStream.getTracks().forEach((track) => track.stop());
      this.mediaStream = null;
    }
  }

  private reset() {
    this.sessionPromise?.then((session) => session.close());
    this.initSession();
    this.updateStatus('System Reset');
  }

  render() {
    return html`
      <div>
        <div id="title">
          <img class="logo" src="data:image/png;base64," alt="TDU Logo" />
          <div class="title-content">
            <h1>Thanh Dong English Coach</h1>
            <hr/>
            <p>A.I American English Pronunciation Assistant</p>
          </div>
        </div>
        
        <gdm-live-audio-visuals-3d
          .inputNode=${this.inputNode}
          .outputNode=${this.outputNode}
          .isError=${this.visualErrorState}>
        </gdm-live-audio-visuals-3d>

        <div class="controls">
          <button id="resetButton" @click=${this.reset}>
            Replay
          </button>
          
          ${this.isRecording 
            ? html`<button id="stopButton" @click=${this.stopRecording} style="border-color: #ff3333; color: #ff3333;">Stop</button>` 
            : html`<button id="startButton" @click=${this.startRecording}>Start</button>`
          }
        </div>

        <div id="status"> ${this.error ? this.error : this.status} </div>
      </div>
    `;
  }
}
